function formatDateOnChange(inputValue) {
    if (typeof inputValue !== "string") {
        throw new Error("La entrada debe ser una cadena de texto.");
    }

    // Si el valor está vacío, retornar vacío
    if (inputValue.trim() === "") {
        return "";
    }

    // Eliminar caracteres no numéricos
    inputValue = inputValue.replace(/[^0-9]/g, "");

    // Construir partes del formato dinámicamente
    const month = inputValue.slice(0, 2); // Los primeros 2 dígitos (MM)
    const day = inputValue.slice(2, 4);  // Los siguientes 2 dígitos (DD)
    const year = inputValue.slice(4, 8); // Los últimos 4 dígitos (YYYY)

    // Generar el formato dinámico con "/"
    let formattedDate = month;
    if (day) {
        formattedDate += `/${day}`;
    }
    if (year) {
        formattedDate += `/${year}`;
    }

    return formattedDate;
}
